export type CspDirective = string[];
export interface JSONSchemaForCustomApplicationConfigurationFiles {
    name: string;
    description?: string;
    entryPointUriPath: string;
    cloudIdentifier: string;
    mcApiUrl?: string;
    oAuthScopes: {
        view: string[];
        manage: string[];
    };
    additionalOAuthScopes?: {
        name: string;
        view: string[];
        manage: string[];
    }[];
    env: {
        development: {
            initialProjectKey: string;
            teamId?: string;
        };
        production: {
            applicationId: string;
            url: string;
            cdnUrl?: string;
        };
    };
    additionalEnv?: {
        [k: string]: unknown;
    };
    headers?: {
        csp?: {
            'connect-src': CspDirective;
            'font-src'?: CspDirective;
            'img-src'?: CspDirective;
            'script-src'?: CspDirective;
            'style-src'?: CspDirective;
            'frame-src'?: CspDirective;
        };
        permissionsPolicies?: {
            [k: string]: unknown;
        };
        strictTransportSecurity?: ('includeSubDomains' | 'preload')[];
    };
    icon: string;
    mainMenuLink: {
        defaultLabel: string;
        labelAllLocales: {
            locale: 'en' | 'de' | 'es' | 'fr-FR' | 'pt-BR' | 'zh-CN';
            value: string;
        }[];
        permissions: string[];
        [k: string]: unknown;
    };
    submenuLinks: {
        uriPath: string;
        defaultLabel: string;
        labelAllLocales: {
            locale: 'en' | 'de' | 'es' | 'fr-FR' | 'pt-BR' | 'zh-CN';
            value: string;
        }[];
        permissions: string[];
        [k: string]: unknown;
    }[];
    [k: string]: unknown;
}
